        const url = 'https://8ygvs8prgf.execute-api.us-east-1.amazonaws.com/dev/';
        const response = await fetch(url);
        const data = await response.json();
        this.setState({ 
            resutl: data.businesses.map((item) => RestaurantCard(item))
         });
    }

